import React, { Component, lazy, Suspense } from 'react';

import { Badge, Button, ButtonDropdown, ButtonGroup, ButtonToolbar, Card, CardBody, CardFooter, CardHeader, CardTitle, Col, Dropdown, DropdownItem, DropdownMenu, DropdownToggle, Progress, Row, Table, } from 'reactstrap';

//import Cardthreelist from '../card-home/Cardthreelist';
import Cardthree from '../card-home/Cardthree';

import Cardpromo from '../card-home/Cardpromo';

/*const initialdatas = [
  { id: 1, title: 'Lo que viene 1', descript: '1.-Culpa quis exercitation ea fugiat magna proident ipsum commodo tempor laboris elit.'},
  { id: 2, title: 'Lo que viene 2', descript: '2.-Culpa quis exercitation ea fugiat magna proident ipsum commodo tempor laboris elit.'},
  { id: 3, title: 'Lo que viene 3', descript: '3.-Culpa quis exercitation ea fugiat magna proident ipsum commodo tempor laboris elit.'},
];*/
const initipromo = [
  { id: 1, title: 'Promocion 1', descript: '1.-Culpa quis exercitation ea fugiat magna proident ipsum commodo tempor laboris elit.'},
];

class Dashboard extends Component {
  constructor(props) {
    super(props);

    this.state = {
      initialdatas: [
        { id: 1, title: 'Lo que viene 1', descript: '1.-Culpa quis exercitation ea fugiat magna proident ipsum commodo tempor laboris elit.', imgurl:'https://cdn-ami-drupal.heartyhosting.com/sites/muscleandfitness.com/files/flex/6_12.jpg'},
        { id: 2, title: 'Lo que viene 2', descript: '2.-Culpa quis exercitation ea fugiat magna proident ipsum commodo tempor laboris elit.', imgurl:'https://www.izotope.com/en/blog/music-production/7-home-recording-studio-myths/_jcr_content/image.img.jpg/1547649975903.jpg'},
        { id: 3, title: 'Lo que viene 3', descript: '3.-Culpa quis exercitation ea fugiat magna proident ipsum commodo tempor laboris elit.', imgurl:'https://www.muscleathleticsports.com/wp-content/uploads/2017/12/51875019_121070799001096_15001034878618338_n-1024x683.jpg'},
      ],
      initipromo : [
        { id: 1, title: 'Promocion 1', descript: '1.-Culpa quis exercitation ea fugiat magna proident ipsum commodo tempor laboris elit.', imgurl:'https://www.fotojet.com/template-imgs/social-media-header/youtube-thumbnail/build-body-youtube-thumbnail.jpg'},
      ],
      promotxt:initipromo,
    };
  }

  render() {
    const {cardtxt, promotxt} = this.state;
    return (
      <div className="animated fadeIn">
        <Row>
          <Col xs="12"  md="9">
            <Row>
              {
                this.state.initialdatas.map((item,i) => { 
                  return (<Cardthree thumbnail={item}/>);
                })
              }
            </Row>
            <Row>
              {
                this.state.initialdatas.map((item,i) => { 
                  return (<Cardthree thumbnail={item}/>);
                })
              }
            </Row>            
          </Col>
          <Col xs="12" md="3"> 
              {
                this.state.initipromo.map((item,i) => {
                  return (<Cardpromo thumbnail={item}/>);
                })
              }
          </Col>
        </Row>
        <Row>
          {
            this.state.initialdatas.map((item,i) => { 
              return (<Cardthree thumbnail={item}/>);
            })
          }          
        </Row>
        <Row>
          <Col xs="12"  md="9">
            <Row>
              {
                this.state.initialdatas.map((item,i) => { 
                  return (<Cardthree thumbnail={item}/>);
                })
              }
            </Row>          
          </Col>
          <Col xs="12" md="3"> 
              {
                this.state.initipromo.map((item,i) => {
                  return (<Cardpromo thumbnail={item}/>);
                })
              }
          </Col>
        </Row>
      </div>
    );
  }
}

export default Dashboard;
